import React from 'react';

import classNames from '';

class Button extends React.Component {
  render() {
    console.log(this.props);

    return (
      <button className={`button ${this.props.outline ? 'button--outline' : ''}`}>
        {this.props.text}{' '}
      </button>
    );
  }
}

export default Button;
